import { StrictMode } from 'react';
import ReactDOM from 'react-dom';

import App from './App';

const rootElement = document.getElementById('root');
ReactDOM.render(
  <StrictMode>
    <div
      style={{
        border: '1px solid',
        padding: '150px',
        display: 'flex',
        justifyContent: 'center'
      }}
    >
      <App />
    </div>
  </StrictMode>,
  rootElement
);
